import styles from './App.module.css';


//app is known as component
function App() {
  const age=11;
  const isGreen=false;
  return (
    <div className={styles.App}>
      {age <=5 ? <h1>over age</h1> : <h1>under age</h1>}
      <h1 style={{color: isGreen ? "green" : "red"}}>this has color</h1>
    </div>
  );
};

export default App;
